import { useState } from "react";
import classNames from "classnames";
import './App.scss';

// TODO
// 1. Update current alert styles
// 2. Update new alert styles
// 3. Improve emphasis styles

function App() {
  const [headerText, setHeaderText] = useState("Header");
  const [bodyText, setBodyText] = useState("This is the body text.");
  const [actionLinkLabel, setActionLinkLabel] = useState("Action Link");
  const [emphasis, setEmphasis] = useState("info");
  const [reducedOpacity, setReducedOpacity] = useState(false);
  const [stroke, setStroke] = useState(false);
  const [iconColor, setIconColor] = useState(false);

  return (
    <div className="App">
      <div className="section setup">
        <div className="section--header">
          <h1>Setup</h1>
        </div>
        <div className="section--main">
          <div>
            <div className="setup--block">
              <p className="label">Emphasis</p>
              {
                ALERT_EMPHASES.map(option => (
                  <label>
                    <input
                      type="radio"
                      name="emphasis"
                      key={option}
                      id={option}
                      value={option}
                      checked={option === emphasis}
                      onChange={event => {
                        setEmphasis(event.target.value)
                      }}
                    />
                    {option}
                  </label>
                ))
              }
            </div>
            <div className="setup--block">
              <p className="label">New Alert Options</p>
              <label>
                <input
                  type="checkbox"
                  checked={reducedOpacity}
                  onChange={event => {
                    setReducedOpacity(event.target.checked)
                  }}
                />
                Lighter background
              </label>
              <label>
                <input
                  type="checkbox"
                  checked={stroke}
                  onChange={event => {
                    setStroke(event.target.checked)
                  }}
                />
                Stroke
              </label>
              <label>
                <input
                  type="checkbox"
                  checked={iconColor}
                  onChange={event => {
                    setIconColor(event.target.checked)
                  }}
                />
                Colored Icon
              </label>
            </div>
          </div>
          <div>
            <div className="setup--block">
              <label>
                <p className="label">Header Text (Optional)</p>
                <input
                  value={headerText}
                  onChange={e => setHeaderText(e.target.value)} />
              </label>
            </div>
            <div className="setup--block">
              <label>
                <p className="label">Body Text</p>
                <textarea
                  value={bodyText}
                  onChange={e => setBodyText(e.target.value)}
                  rows={5} />
              </label>
            </div>
            <div className="setup--block">
              <label>
                <p className="label">Action Link Label (Optional)</p>
                <input
                  value={actionLinkLabel}
                  onChange={e => setActionLinkLabel(e.target.value)} />
              </label>
            </div>
          </div>
        </div>
      </div>

      <div className="section examples">
        <h1 className="section--header">
          Examples
        </h1>
        <div className="section--main">
          <div className="example">
            <p className="label">Current</p>
            <AlertCurrent
              emphasis={emphasis}
              header={headerText}
              body={bodyText}
              actionLink={actionLinkLabel}
            />
          </div>
          <div className="example">
            <p className="label">New</p>
            <AlertNew
              emphasis={emphasis}
              header={headerText}
              body={bodyText}
              actionLink={actionLinkLabel}
              reducedOpacity={reducedOpacity}
              stroke={stroke}
              iconColor={iconColor}
            />
          </div>
        </div>
      </div>
    </div >
  );
}

function AlertCurrent({ emphasis, header, body, actionLink }) {
  return (
    <div className={`Alert current ${emphasis}`}>
      <div className="Alert--icon">
        {ALERT_ICONS[emphasis]}
      </div>
      <div className="Alert--content">
        {header && <div className="Alert--header">
          <h2>{header}</h2>
        </div>}
        <div className="Alert--body">
          {body}
        </div>
        {actionLink && <div className="Alert--action">
          <button className="action-link">{actionLink}</button>
        </div>}
      </div>
    </div>
  );
}

function AlertNew({ emphasis, header, body, actionLink, reducedOpacity, stroke, iconColor }) {

  return (
    <div className={classNames("Alert new", emphasis, { light: reducedOpacity, stroke: stroke })}>
      <div className={classNames("Alert--icon", iconColor && emphasis)}>
        {ALERT_ICONS[emphasis]}
      </div>
      <div className="Alert--content">
        {header && <div className="Alert--header">
          <h3>{header}</h3>
        </div>}
        <div className="Alert--body">
          {body}
        </div>
        {actionLink && <div className="Alert--action">
          <button className="action-link">{actionLink}{linkArrow}</button>
        </div>}
      </div>
    </div >
  );
}

const ALERT_EMPHASES = [
  "info",
  "success",
  "warning",
  "critical",
  "highlight",
  "neutral",
  "passive",
  "internal"
]



const linkArrow = <svg width="24" height="24" viewBox="0 0 24 24" fill="currentColor" xmlns="http://www.w3.org/2000/svg">
  <path d="M21.5303 11.4772L16.5303 6.4772C16.3912 6.33709 16.1969 6.25598 15.9994 6.25562C15.802 6.25526 15.6074 6.33566 15.4678 6.47526C15.3282 6.61486 15.2478 6.80948 15.2481 7.0069C15.2485 7.20432 15.3296 7.39865 15.4697 7.53774L19.1724 11.2404H3C2.80109 11.2404 2.61032 11.3194 2.46967 11.46C2.32902 11.6007 2.25 11.7915 2.25 11.9904C2.25 12.1893 2.32902 12.3801 2.46967 12.5207C2.61032 12.6614 2.80109 12.7404 3 12.7404H19.2065L15.4697 16.4772C15.3296 16.6163 15.2485 16.8106 15.2481 17.008C15.2478 17.2055 15.3282 17.4001 15.4678 17.5397C15.6074 17.6793 15.802 17.7597 15.9994 17.7593C16.1969 17.759 16.3912 17.6778 16.5303 17.5377L21.5303 12.5377C21.6696 12.3985 21.75 12.2044 21.75 12.0075C21.75 11.8105 21.6696 11.6164 21.5303 11.4772Z" fill="#111111" />
</svg>;

export default App;
